// src/components/ProblemPage.js

import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './ProblemPage3.css';

const ProblemPage3 = () => {
  // providing hints
  const [showHint, setShowHint] = useState(false);
  const handleShowHint = () => {
    setShowHint(true);
  };
  const handleCloseHint = () => {
    setShowHint(false);
  };

  // providing hints
  const [answer, setAnswer] = useState('');
  const [errorMessage, setErrorMessage] = useState('');
  const navigate = useNavigate();

  const handleInputChange = (e) => {
    setAnswer(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Check if the answer is correct (you can replace this with your own logic)
    if (answer.toLowerCase() === '8') {
      setErrorMessage('');
      // Move to the next problem if the answer is correct
      navigate('/endingPage');
    } else {
      // Show an error message if the answer is incorrect
      setErrorMessage('Incorrect answer. Please try again.');
    }
  };
  return (
    <div className=" h-screen">
      {/* Top Row */}
      <div className="flex justify-center items-center h-12 bg-indigo-200">
        <div className="flex-none w-12 p-4" />
        <div className="flex-none w-px h-full bg-black" />
        <div className="flex-grow p-4" />
        <div className="flex-none w-px h-full bg-black" />
        <div className="flex-none w-12 p-4" />
      </div>

      <div className="h-px bg-black" />

      {/* Header Row */}
      <div className="flex justify-center items-center h-12 bg-violet-200	">
        <div className="flex-none w-12 p-4" />
        <div className="flex-none w-px h-full bg-black" />
        <div className="flex-grow p-4 font-mono text-sm	font-semibold uppercase tracking-widest">Romeo & Juliet / Problem 03</div>
        <div className="flex-none w-px h-full bg-black" />
        <div className="flex-none w-12 p-4" />
      </div>

      <div className="h-px bg-black" />

      {/* Problem Row */}
      <div className="flex justify-center items-center h-full bg-indigo-200">
        <div className="flex-none w-12 p-4" />
        <div className="flex-none w-px h-full bg-black" />
        <div className="flex-grow p-4">
          <div className="grid grid-cols-2 gap-2">
            {/* Problem Statement */}
            <div className="font-sans">
              <div>Perfect Romeo! You are closer of enjoying the life with your loved Juliet. You have achieved entering in the computer, however it seems like there is a new password. Now the password is of 4 numbers. In the screen of your computer appears the following: Huddersfield â€“ Mary Markey</div>
              <div>
                <form onSubmit={handleSubmit}>
                  <label>
                    Code: 
                    <input className="bg-red" type="text" value={answer} onChange={handleInputChange} />
                  </label>
                  <button className="" type="submit">Submit - Go to Ending Page</button>
                </form>
                {errorMessage && <p>{errorMessage}</p>}
              </div>
            </div>
            {/* Supporting Image */}
            <div>img</div>
          </div>
        </div>
        <div className="flex-none w-px h-full bg-black" />
        <div className="flex-none w-12 p-4" />
      </div>

      <div className="h-px bg-black" />

      {/* Footer Row */}
      <div className="flex justify-center items-center h-6 bg-indigo-200">
        <div className="flex-none w-12 p-4" />
        <div className="flex-none w-px h-full bg-black" />
        <div className="flex-grow p-4" />
        <div className="flex-none w-px h-full bg-black" />
        <div className="flex-none w-12 p-4" />
      </div>



      {/* <div className="problem-page-3">
      <h2>Problem 3</h2>
      <h3>What is 2x4?</h3>
      <button onClick={handleShowHint}>Hint</button>
      {showHint && (
        <div className="hint-modal">
          <p>Hint: 2+2+2+2</p>
          <button onClick={handleCloseHint}>Close</button>
        </div>
      )}

      <form onSubmit={handleSubmit}>
        <label>
          Answer:
          <input type="text" value={answer} onChange={handleInputChange} />
        </label>
        <button className="" type="submit">Submit - Go to Ending Page</button>
      </form>
      {errorMessage && <p>{errorMessage}</p>}
    </div> */}
    </div>
  );

}

export default ProblemPage3;
